import styled from "styled-components";

const Sidebar = styled.aside`
font-size: 14px;
font-weight: 600;
width: 10rem;
box-sizing: border-box;
`;

const Aside = ({marca}) => {
    return(
        <Sidebar>
            <label>
                <input type="checkbox"/>
                {marca}
            </label>
        </Sidebar>
    )
}
export default Aside;
